                    <li>Accueil</li>
                </NavLink>

                <li className="nav-portfolio">port-folio
                <ul className="nav-project">
                    <NavLink to="/project-1" activeClassName="nav-active"
                    className="hover">
                        <li>project</li>
                    </NavLink>
                </ul>
                </li>
            </ul>
        </div>
    );
};

export default Navigation;
